        public static void HTMLExportation(string reqID, string FinalDecision, string type, int LCID)
        {
            try
            {
                string sHTMLDocument = string.Empty;
                string fileName = "FinalDecision";
                sHTMLDocument = HTMLFinalDecisionConstructor(reqID, FinalDecision, "HTML", LCID);
                System.Web.HttpResponse Response = System.Web.HttpContext.Current.Response;

                Response.Clear();
                Response.Buffer = true;
                Response.Charset = "UTF-8";
                Response.ContentEncoding = System.Text.Encoding.UTF8;
                Response.Cache.SetCacheability(HttpCacheability.Private);
                if (type != "online")
                {
                    Response.AddHeader("Content-Disposition", "attachment; filename=" + fileName + ".html");
                    Response.ContentType = "text/html";
                }

                Response.Write(sHTMLDocument);
                Response.End();
            }
            catch (Exception ex)
            {
                Logging.GetInstance().LogException(ex);
            }
            finally
            {
                Logging.GetInstance().Debug("Exiting method AllProcedures.AddDecisions");
            }
        }
        public static string HTMLFinalDecisionConstructor(string reqID, string FinalDecision, string DocType, int LCID)
        {
            string code = string.Empty;
            bool isArabicSite = (SPContext.Current.Web.UICulture.LCID == 1025);
            try
            {
                //header
                code = @"<html lang='en' xmlns='http://www.w3.org/1999/xhtml'><head><meta charset='utf-8' /><meta http-equiv='X-UA-Compatible' content='IE=Edge' />";

                if (DocType == "HTML")
                {
                    code += @"<title>" + HelperMethods.LocalizedText("ITWORX_MOEHEWF_UCE", "FinalDecision", (uint)LCID) + "</title>";
                    code += StrinStyles();
                }
                code += @"</head><body>";
                if (DocType == "HTML")
                {
                    code += HTMLInlineLogo();
                }
                if (isArabicSite && DocType == "PDF") code += @"<table><tr><th class='headertitle'>";
                if (DocType == "PDF") code += @"<b>";
                code += @"<h1>" + HelperMethods.LocalizedText("ITWORX_MOEHEWF_UCE", "RequestNo", (uint)LCID) + ":" + reqID + "</h1>";
                if (DocType == "PDF") code += @"</b>";
                if (isArabicSite && DocType == "PDF") code += @"</th></tr></table>";

                //FinalDecision
                if (FinalDecision != null)
                {
                    // code += @"<div>";
                    // if (DocType == "PDF") code += @"<h4>-</h4>";
                    code += @"<div>" + FinalDecision + "</div> ";

                }
                else
                {
                    if (DocType == "PDF") code += @"<h4>-</h4>";
                    code += @"<div><h1>" + HelperMethods.LocalizedText("ITWORX_MOEHEWF_UCE", "RequestNo", (uint)LCID) + ":" + reqID + "</h1>" +
                        "<p  class='notes' >" + HelperMethods.LocalizedText("ITWORX_MOEHEWF_UCE", "NoFinalDecision", (uint)LCID) +
                        "</p></div>";
                }
                code += "</body><footer><div><img alt='' src='data:image/png;base64,'" +
                        "/></div></footer></html>";
            }
            catch (Exception ex)
            {
                Logging.GetInstance().LogException(ex);
            }
            finally
            {
                Logging.GetInstance().Debug("Exiting method AllProcedures.AddDecisions");
            }
            return code;
        }
