                var logo = Image.GetInstance(LogoimageBytes);
                //logo.ScalePercent(20);
                logo.ScalePercent(23);
                logo.Alignment = Image.ALIGN_CENTER;
                logo.SpacingBefore = 10f;
                logo.SpacingAfter = 10f;
                document.Add(logo);

                //Adding Title
