                datacellsSignatureTitle[0] = signTitleCell;
                PdfPRow RowDataSignatureTitle = new PdfPRow(datacellsSignatureTitle);

                var signCell = new PdfPCell(new Phrase(equivalencManager, fontData)) { Border = 0, RunDirection = PdfWriter.RUN_DIRECTION_RTL };

                PdfPCell[] datacellsSignature = new PdfPCell[2];
                datacellsSignature[1] = new PdfPCell() { Border = 0 };
                datacellsSignature[0] = signCell;
                PdfPRow RowDataSignature = new PdfPRow(datacellsSignature);


                tableSignatureTitle.Rows.Add(RowDataSignatureTitle);
                tableSignatureTitle.SetWidths(new float[] { 30f, 35f, 35f });
                tableSignatureTitle.WidthPercentage = 110;

                tableSignature.Rows.Add(RowDataSignature);
                tableSignature.SetWidths(new float[] { 43f, 57f });
                tableSignature.WidthPercentage = 110;


                document.Add(tableSignatureTitle);
                document.Add(tableSignature);
                //Adding Footer


                byte[] FooterimageBytes = Convert.FromBase64String(Footerbase64);
                var footer = iTextSharp.text.Image.GetInstance(FooterimageBytes);
                footer.Alignment = iTextSharp.text.Image.ALIGN_BOTTOM;
                footer.ScalePercent(23);
                //footer.SetAbsolutePosition(0, 100);
                footer.SetAbsolutePosition(0, 20);


                document.Add(footer);

                /// Adding barcode to document footer

                string base64String = GenerateBarcodeImage(reqID);
                byte[] barcodeimageBytes = Convert.FromBase64String(base64String);
                var barcode = iTextSharp.text.Image.GetInstance(barcodeimageBytes);
                barcode.Alignment = iTextSharp.text.Image.ALIGN_BOTTOM;
                //barcode.SpacingBefore = 10f;
                //barcode.SpacingAfter = 10f;

                barcode.ScalePercent(50);
                barcode.SetAbsolutePosition(200, 40);
                document.Add(barcode);


                document.Close();
                writer.Close();

                //Calling Response
                Response.ContentType = "application /pdf";
                Response.AddHeader("Content-Disposition", string.Format("attachment;filename={0}.pdf", "FinalDecision"));
                Response.BinaryWrite(output.ToArray());

            }
            catch (Exception ex)
            {
                Logging.GetInstance().LogException(ex);
            }
            finally
            {
                Logging.GetInstance().Debug("Exiting method FinalDecisionPrint.GenerateUCEPDF");
            }
        }
